type BtnProps = {
    border?: string;
    color?: string;
    children?: React.ReactNode;
    height?: string;
    onClick?: () => void;
    radius?: string
    width?: string;
};

const Primary = (props: BtnProps) => {
    return (
        <button>{props.children}</button>
    );
};

const Secondary = (props: BtnProps) => {
    return (
        <button>{props.children}</button>
    );
};

